import React from 'react'
import PropTypes from 'prop-types'

const BookItem = props => {
    return (
        <div>
            <Link to={`/book`}>
            <div className="card">Think and Grow Rich</div>
            </Link>
        </div>
    )
}

BookItem.propTypes = {
    book: PropTypes.object.isRequired,
}

export default BookItem
